	(1, 2, 'trackUpdate'),
INSERT INTO `guides` (`id`, `title`, `description`, `content`, `link`) VALUES
	(1, 'P/E', 'Price per Earnings', 'Chỉ số P/E (Price to Earning ratio) là chỉ số đánh giá mối quan hệ giữa giá thị trường của cổ phiếu (Price) với thu nhập trên một cổ phiếu (EPS).\n\n \n Ý nghĩa của chỉ số này thể hiện mức giá mà bạn sẵn sàng bỏ ra cho một đồng lợi nhuận thu được từ cổ phiếu. Hay, bạn sẵn sàng trả giá bao nhiêu cho cổ phiếu của một doanh nghiệp dựa trên lợi nhuận (thu nhập) của doanh nghiệp đó.\n\n \n Công thức tính chỉ số P/E:\n\n \n P/E = Giá thị trường của cổ phiếu (Price)/Thu nhập trên một cổ phiếu (EPS)\n\n Ví dụ: Giả sử giá thị trường tại thời điểm 31/12/2020 của cổ phiếu X là 22.000 đồng, thu nhập trên mỗi cổ phiếu (EPS) trong năm của công ty này là 2.000 đồng. Như vậy, P/E của cổ phiếu X là 11.', 'https://vnexpress.net/chi-so-p-b-p-e-la-gi-4296226.html'),
	(2, 'EPS', 'Earning per Shares', 'Chỉ số EPS là viết tắt của Earnings Per Share (Thu nhập trên mỗi cổ phiếu), hay phần lợi nhuận sau thuế trên mỗi cổ phiếu thường của các cổ đông, sau khi đã trừ đi cổ tức ưu đãi. \n\n \n EPS được tính bằng cách chia thu nhập ròng mà công ty kiếm được trong một kỳ báo cáo (quý hoặc năm) với tổng số cổ phiếu hiện đang được lưu hành của công ty trong cùng kỳ. Vì số cổ phiếu đang lưu hành có thể dao động, nên khi tính toán, việc sử dụng lượng cổ phiếu lưu hành bình quân trong kỳ sẽ đem lại kết quả chính xác hơn.\n\n \n ', 'https://vnexpress.net/chi-so-eps-la-gi-4461207.html'),
	(4, 'P/B', 'Price to Book value ', 'Chỉ số P/B (Price-to-Book ratio) là tỷ lệ được sử dụng để so sánh giá của một cổ phiếu với giá trị sổ sách của cổ phiếu đó. Tỷ lệ này được tính toán bằng cách lấy giá đóng cửa hiện tại của cổ phiếu chia cho giá trị ghi sổ tại quý gần nhất của cổ phiếu đó.\n\n \n Công thức tính như sau: \n\n \n P/B = Giá thị trường của cổ phiếu (Price) / Giá trị ghi sổ của cổ phiếu (Book value per Share) \n\n \n Trong đó: \n Giá trị ghi sổ trên 1 cổ phiếu = (Tổng giá trị tài sản – Giá trị tài sản vô hình – Nợ) / Số lượng cổ phiếu lưu hành \n\n \n Ví dụ: Giả sử một công ty có giá trị tài sản ghi nhận trên bảng cân đối kế toán là 200 tỷ đồng, tổng nợ 150 tỷ đồng, như vậy giá trị ghi sổ của công ty là 50 tỷ. Hiện tại công ty có 2 triệu cổ phiếu đang lưu hành, như vậy giá trị ghi sổ của mỗi cổ phiếu là 25.000 VND. Nếu giá thị trường của cổ phiếu đang là 75.000 VND, thì P/B của cổ phiếu được tính như sau: \n P/B = 75.000/25.000 = 3', 'https://vnexpress.net/chi-so-p-b-p-e-la-gi-4296226.html'),
	(5, 'ROE', 'Return on Equity', 'ROE (Return on Equity) là chỉ số đo lường hiệu quả hoạt động của công ty trong việc sử dụng vốn chủ sở hữu để tạo ra lợi nhuận. Chỉ số này phản ánh tỷ lệ lợi nhuận thu được so với vốn chủ sở hữu của công ty. ROE thường được sử dụng để đánh giá hiệu quả quản lý và phân tích tính khả thi của việc đầu tư vào công ty.\n\nCông thức tính như sau:\n\nROE = Lợi nhuận sau thuế / Vốn chủ sở hữu\n\nTrong đó:\n- Lợi nhuận sau thuế là lợi nhuận gộp trừ đi các khoản chi phí thuế.\n- Vốn chủ sở hữu là tổng số vốn mà các chủ sở hữu đã đầu tư vào công ty.\n\nVí dụ: Giả sử một công ty có lợi nhuận sau thuế là 100 tỷ đồng và vốn chủ sở hữu là 500 tỷ đồng, thì ROE của công ty được tính như sau:\nROE = 100 tỷ / 500 tỷ = 0.2 hoặc 20%\n\nROE càng cao thì công ty càng hiệu quả trong việc sử dụng vốn chủ sở hữu để tạo ra lợi nhuận.', 'https://vnexpress.net/roa-roe-la-gi-4304366.html'),
	(6, 'ROA', 'Return on Assets', 'ROA (Return on Assets) là chỉ số đánh giá hiệu quả sử dụng tài sản của công ty để tạo ra lợi nhuận. Chỉ số này cho biết tỷ lệ lợi nhuận thu được so với số lượng tài sản mà công ty sở hữu hoặc quản lý. ROA thường được sử dụng để đo lường năng suất của tài sản và hiệu quả quản lý của công ty.\n\nCông thức tính như sau:\n\nROA = Lợi nhuận sau thuế / Tổng tài sản\n\nTrong đó:\n- Lợi nhuận sau thuế là lợi nhuận gộp trừ đi các khoản chi phí thuế.\n- Tổng tài sản là tổng giá trị của tất cả các tài sản mà công ty sở hữu hoặc quản lý.\n\nVí dụ: Giả sử một công ty có lợi nhuận sau thuế là 150 tỷ đồng và tổng tài sản là 1,000 tỷ đồng, thì ROA của công ty được tính như sau:\nROA = 150 tỷ / 1,000 tỷ = 0.15 hoặc 15%\n\nROA càng cao thì công ty càng hiệu quả trong việc sử dụng tài sản để tạo ra lợi nhuận.', 'https://vnexpress.net/roa-roe-la-gi-4304366.html'),
	(7, 'RSI', 'Relative Strength Index', 'RSI (Relative Strength Index) là một chỉ báo kỹ thuật được sử dụng để đo lường sự mạnh mẽ của một xu hướng giá. Chỉ báo này cũng được sử dụng để xác định mức độ quá mua hoặc quá bán của một tài sản. RSI được tính toán bằng cách so sánh số lượng lợi nhuận trong một khoảng thời gian nhất định với số lượng lỗ trong cùng khoảng thời gian đó.\n\nCông thức tính như sau:\n\nRSI = 100 - (100 / (1 + RS))\n\nTrong đó:\n- RS (Relative Strength) là tỷ số của số lượng lợi nhuận trung bình trong các phiên tăng giá so với số lượng lỗ trung bình trong các phiên giảm giá. Đây là một chỉ số đo lường sự mạnh mẽ của xu hướng giá.\n\nVí dụ: Giả sử trong 14 ngày gần nhất, tổng số lợi nhuận là 800 điểm và tổng số lỗ là 600 điểm. Khi đó, RS sẽ là 1.33.\n\nRSI càng cao (trên mức 70), thì tài sản có thể bị coi là quá mua và có thể là dấu hiệu của một điểm bán. Ngược lại, RSI càng thấp (dưới mức 30), thì tài sản có thể bị coi là quá bán và có thể là dấu hiệu của một điểm mua. \n\nRSI phân kỳ \nKhi giá của tài sản di chuyển ngược chiều với chỉ báo RSI, điều này có thể cho thấy một sự thay đổi xu hướng tiềm năng. Ví dụ, nếu giá của một tài sản tăng nhưng RSI giảm, điều này có thể báo hiệu rằng xu hướng tăng đang mất đà và có thể sắp đảo chiều. \n image:rsipk. \n\nRSI hội tụ \nKhi giá của tài sản di chuyển ngược chiều với chỉ báo RSI, điều này có thể cho thấy một sự thay đổi xu hướng tiềm năng. Ví dụ, nếu giá giảm nhưng RSI tăng, điều này có thể cho thấy xu hướng giảm đang mất đà và có thể sắp đảo chiều. \n image:rsiht.', 'https://vnexpress.net/chi-bao-rsi-la-gi-4481781.html');
